import {
    REGISTER_SUCCESS,
    REGISTER_FAIL,
    USER_LOADED,
    AUTH_ERROR,
    LOGIN_SUCESS,
    LOGIN_FAIL,
    LOGOUT,
    CLEAR_ERRORS
} from '../type';



export default (state, action ) => {
    switch (action.type) {
        case REGISTER_SUCCESS:
            localStorage.setItem("token")
            return {
                ...state,

            }
            
            break;
    
        default:
            break;
    }
}
